import React from "react";
import { LabelsProps } from "../data/interfaces";
import { MyUsers } from "../data/users";
import { UserProps } from "../data/interfaces";
import UserFullDatas from "../helper/users-comp";

const mapDatas = MyUsers.map((data: UserProps, index) =>
    <p key={`el-${index}`}>{data.name}</p>
);


const Homepage = ({loadingMessage, errorMessage, overallMessage} : LabelsProps) => {
    return(
        <>
            <p>This is the homepage</p>
            <p>{overallMessage}</p>
            <p>{errorMessage}</p>

            <ul>
                {MyUsers.map((data: UserProps, index) =>
                <li className="usersList" key={`el-${index}`}>
                    <UserFullDatas
                    name = {data.name} 
                    last_name = {data.last_name}
                    city = {data.city}
                    country= {data.country}
                    books= {data.books}
                    />  
                </li>
                )}
            </ul>

            {mapDatas}
        </>
    )
}

export default Homepage;
